import React from 'react';
import { Provider } from 'react-awesome-slider/dist/navigation';
import './layout.css';
import Nav from '../nav/nav';
import Select from '../select/select';

const Layout = ({ children, page }) => {
  return (
    <Provider page={page}>
      <Nav />
      <Select />
      <main>{children}</main>
    </Provider>
  );
};

export default Layout;
